ControlPropertyState.AutoRuleBindingString:
If(
    GlrVisãoPlanejador.Selected.'Status usuário Medida' = "CANC" Or GlrVisãoPlanejador.Selected.'Status usuário Medida' = "ELIM",
    UpdateContext(
        {
            PopUpPlanejamento: "cancelar",
            ItemCancelamento: GlrVisãoPlanejador.Selected,
            vcPopUp: true
        }
    ),
    Patch(/*ESTE CODIGO SUBSTITUI O FORMULÁRIO 'FrmAtualizaMedidaPlan'*/
        'AcompanhamentoPARADA HDS: U-0106',
        LookUp(
            'AcompanhamentoPARADA HDS: U-0106',
            Título = GlrVisãoPlanejador.Selected.IDInsp
        ),
        {
            TextoBrevedaMedida: GlrVisãoPlanejador.Selected.'Texto breve da Medida',
            TextoLongodaMedida: GlrVisãoPlanejador.Selected.'Texto longo (Medida)',
            StatusSistemaMedida: GlrVisãoPlanejador.Selected.'Status sistema Medida',
            StatusUsuarioMedida: GlrVisãoPlanejador.Selected.'Status usuário Medida'
        }
    );
    Patch(/*ESTE CODIGO SUBSTITUI O FORMULÁRIO 'FrmMarcaPlanejado'*/
        ListaZRsU106,
        If(
            PopUpPlanejamento = "cancelar",
            LookUp(
                ListaZRsU106,
                IDInsp = GlrAnaliseCancelamentoPlan.Selected.Título
            ),
            LookUp(
                ListaZRsU106,
                IDInsp = GlrVisãoPlanejador.Selected.IDInsp
            )
        ),
        {
            Planejado: Now(),
            Planejador: User().Email
        }
    )
)
