If(/*SE A GALERIA ESTIVER VAZIA...*/
    GlrPopUpPlan_1.AllItemsCount = 0,
    UpdateContext(
        {
            PopUpPlanejamento: "",
            vcPopUp: false,
            vcItemModificado: false
        }
    ),/*NÃO ABRE POPUP, SE NÃO*/
    If(/*SE FOR PLANEJAMENTO COMPLETO...*/
        VarplanejamentoCompleto = true,
        UpdateContext(
            {
                loading: true,
                vcPopUp: false,
                vcItemModificado: false
            }
        );
        Patch(/*MARCA A SUBMEDIDA COMO PLANEJADA*/
            vgSWListaZR,
            LookUp(
                vgSWListaZR,
                If(
                    PopUpPlanejamento = "cancelar",
                    IDInsp = ItemCancelamento.IDInsp,
                    IDInsp = GlrVisãoPlanejador.Selected.IDInsp
                )
            ),
            {
                Planejado: Now(),
                Planejador: User().Email
            }
        );
        UpdateContext(/*LIMPA VARIAVEIS*/
            {
                PopUpPlanejamento: "",
                ItemCancelamento: Blank(),
                VarItemPlanejado: Blank(),
                loading: false,
                vcItemModificado: false
            }
        ),
        If(
            Button1_229.Text = "Voltar",
            UpdateContext(
                {
                    PopUpPlanejamento: "",
                    vcPopUp: false,
                    vcItemModificado: false
                }
            ),/*...SE NÃO FOR PLANEJAMENT COMPLETO*/
            UpdateContext({loading: true});
            Patch(/*MARCA A SUBMEDIDA COMO PLANEJADA*/
                vgSWListaZR,
                LookUp(
                    vgSWListaZR,
                    If(/*SE FOR CANCELAMENTO...*/
                        PopUpPlanejamento = "cancelar",
                        IDInsp = ItemCancelamento.IDInsp,/*...SE NÃO FOR*/
                        IDInsp = GlrVisãoPlanejador.Selected.IDInsp
                    )
                ),
                {
                    Planejado: Now(),
                    Planejador: User().Email
                }
            )
        );
        Navigate('FluxoAtividades 2.0');
        Navigate('VisãoPlanejador2.0');
        UpdateContext(
            {
                PopUpPlanejamento: "",
                VarItemPlanejado: Blank(),
                ItemCancelamento: Blank(),
                VarplanejamentoCompleto: false,
                vcPopUp: false,
                loading: false,
                vcItemModificado: false
            }
        )
    )
);
ResetForm(FrmPlanejamentoNovaSubmedidaEND)

Switch(
    PopUpPlanejamento,
    "descartar",
    UpdateContext(
        {
            loading: true,
            vcPopUp: false
        }
    );
    Patch(
        vgSWEventosParadas,
        Defaults(vgSWEventosParadas),
        {
            Title: "Medida Descartada pelo Planejamento",
            MedidaRelacionadaPrincipal: GlrVisãoPlanejador.Selected.IDInsp,
            Descricao: "Medida descartada durante análise do planejamento",
            EquipamentoEnvolvidoPrincipal: CbxFiltroTagGrupoFluxoEventos_3.Selected.Title,
            Responsavel: User().Email
        }
    );
    Patch(/*ESTE CODIGO SUBSTITUI O FORMULÁRIO 'FrmMarcaPlanejado'*/
        vgSWListaZR,
        GlrVisãoPlanejador.Selected,
        {
            Planejado: Now(),
            Planejador: User().Email
        }
    );
    Navigate('FluxoAtividades 2.0');
    Navigate('VisãoPlanejador2.0');
    UpdateContext(
        {
            PopUpPlanejamento: "",
            TimerStart: true,
            vcItemModificado: false
        }
    ),
    "planejar",
    UpdateContext(
        {
            loading: true,
            vcPopUp: false
        }
    );
    Patch(/*CRIA NOVA SUBMEDIDAO CÓDIGO ABAIXO SUBSTITUI ESTE FORMULÁRIO*/
        vgSWAcompanhamentoParadas,
        Defaults(vgSWAcompanhamentoParadas),
        {
            NumNota: VarItemPlanejado.'Nº da Nota',
            NumParte: Value(VarItemPlanejado.'Id Parte'),
            NumMedida: VarItemPlanejado.'Nº Medida',
            NumSubMedida: Max(
                Filter(
                    vgSWAcompanhamentoParadas,
                    NotaParteMedida = VarItemPlanejado.NotaParteMedida
                ),
                NumSubMedida
            ) + 1,
            Title: VarItemPlanejado.'Nº da Nota' & "." & VarItemPlanejado.'Id Parte' & "." & VarItemPlanejado.'Nº Medida' & "." & Max(
                Filter(
                    vgSWAcompanhamentoParadas,
                    NotaParteMedida = VarItemPlanejado.NotaParteMedida
                ),
                NumSubMedida
            ) + 1,
            Equipamento: CbxSelecEquipPlan_1.Selected.Title,
            Tipo1: LookUp(
                vgSWEquipamentosParadas,
                Title = VarItemPlanejado.'Tag Local SAP',
                Tipo1
            ),
            Servico: LookUp(
                vgSWEquipamentosParadas,
                Title = VarItemPlanejado.'Tag Local SAP',
                Servico
            ),
            TextoBrevedaMedida: VarItemPlanejado.'Texto breve da Medida',
            TextoLongodaMedida: VarItemPlanejado.'Texto longo (Medida)',
            PLH: LookUp(
                vgSWEquipamentosParadas,
                Title = VarItemPlanejado.'Tag Local SAP',
                PLH
            ),
            TIE: LookUp(
                vgSWEquipamentosParadas,
                Title = VarItemPlanejado.'Tag Local SAP',
                TIE
            ),
            DataCriacaoMedida: VarItemPlanejado.'Data modificação (Medida)',
            StatusSistemaMedida: VarItemPlanejado.'Status sistema Medida',
            StatusUsuarioMedida: VarItemPlanejado.'Status usuário Medida',
            TipoEnsaio: CbxSelecTipoEnsaioPlan_1.Selected.TipoEnsaio,
            EnsaioServico: CbxSelecEnsaioServiçoPlan_2.Selected.'Ensaios/Serviços',
            ImpeditivoLV: vcImpeditivoLV
        }
    );
    Patch(/*CRIA EVENTO DA CRIAÇÃO DA SUBTAREFA*/
        vgSWEventosParadas,
        Defaults(vgSWEventosParadas),
        {
            Title: "Nova Submedida Adicionada a Base de Dados",
            Responsavel: User().Email,
            UsuarioDesignadoPrincipal: LookUp(
                vgSWAcompanhamentoParadas,
                ID = Max(
                    vgSWAcompanhamentoParadas,
                    ID
                ),
                PLH
            ),
            UsuarioDesignadoSecundario: LookUp(
                vgSWAcompanhamentoParadas,
                ID = Max(
                    vgSWAcompanhamentoParadas,
                    ID
                ),
                TIE
            ),
            MedidaRelacionadaPrincipal: LookUp(
                vgSWAcompanhamentoParadas,
                ID = Max(
                    vgSWAcompanhamentoParadas,
                    ID
                ),
                Title
            ),
            NotificacaoObrigatoria: "EXECUTOR",
            EquipamentoEnvolvidoPrincipal: LookUp(
                vgSWAcompanhamentoParadas,
                ID = Max(
                    vgSWAcompanhamentoParadas,
                    ID
                ),
                Equipamento
            )
        }
    );
    Navigate('FluxoAtividades 2.0');
    Navigate('VisãoPlanejador2.0');
    UpdateContext(
        {
            TimerStart: true,
            vcImpeditivoLV: Blank(),
            vcItemModificado: false
        }
    ),
    "fluxoinsp",
    SubmitForm(FrmPlanejamentoNovaSubmedidaFluxoInsp);
    SubmitForm(FrmEventosPlan),
    "cancelar",
    UpdateContext(
        {
            loading: true,
            vcPopUp: false
        }
    );
    SubmitForm(FrmEventosPlan);
    Patch(/*ESTE CODIGO SUBSTITUI O FORMULÁRIO 'FrmMarcaPlanejado'*/
        vgSWListaZR,
        LookUp(
            vgSWListaZR,
            IDInsp = GlrAnaliseCancelamentoPlan.Selected.Title
        ),
        {
            Planejado: Now(),
            Planejador: User().Email
        }
    );
    Navigate('FluxoAtividades 2.0');
    Navigate('VisãoPlanejador2.0');
    UpdateContext(
        {
            TimerStart: true,
            vcItemModificado: false
        }
    )
)

ThisItem.IdInsp& " | "&
    If(
        IsBlank(ThisItem.Cadastrado), "Aguardando Cadastro",
        If(
            IsBlank(ThisItem.Executado), "Aguardando Execução",
            If(
                IsBlank(ThisItem.Lançado), "Aguardando Lançamento GISNPEQ",
                If(
                    IsBlank(ThisItem.'Análise NR-13'),"Aguardando Análise NR-13",
                    If(
                        IsBlank(ThisItem.'Analisado e assinado'),"Aguardando Análise PLH",
                        If(
                            !IsBlank(ThisItem.'Analisado e assinado') And CountRows(Filter('Eventos U-613','MedidaRelacionada(Principal)'=ThisItem.IdInsp,Título="Medida Cancelada pelo Planejamento"))>0,"Cancelada"
                        )
                    )
                )
            )
        )
    )
